import React from "react";
import OtherLayout from '../components/OtherLayout';
import Head from "next/head";

const LeaderShip = () => {
    return(
        <>
            <Head>
                <title>Study Board | LeaderShip </title>
            </Head>
            <OtherLayout>
                <div>LeaderSHip </div>
            </OtherLayout>
        </>
    )
};

export default LeaderShip
